function Question({ question }) {
  return (
    <div>
      <h4>{question.question}</h4>
      <div className='options'>
        {question.options.map((option) => (
          <button className='btn btn-option'>{option}</button>
        ))}
      </div>
      {/* <Options question={question} /> */}
    </div>
  );
}

export default Question;
